	function discreteziggurat(){
		var pre = 105, workAF=new Array(pre), workBF=new Array(pre), workCF=new Array(pre), workDF=new Array(pre+1), i=0, s=0, x=0, j=0, m=63, judge,temp=0;
		while(true){
		judge=0;
		i=Math.floor(Math.random() * m+1);
		if(Math.floor(Math.random() *2)==0){
	    s=-1;
        }
        else{
	    s=1;
        }
		x=Math.floor(Math.random() *(_X[i]+1));
		if(x>63){continue;}
		if(x>0&&x<=_X[i-1]){
			return s*x;	
		}
		else{
			if(x==0){
				if(Math.floor(Math.random() *2)==0){
					return s*x;
				}
				else continue;
			}
			else{   //in rejection area
				for(j=0;j<pre;j++){
					//workA[j]=Y[(i-1)*108+j];  //y_i-1
					workBF[j]=Y[(i-1)*pre+j];  //y_i
				}
				for(j=0;j<pre;j++){
					workCF[j]=_y[(i-1)*pre+j];
				}
				//workC=y_i-1 - y_i
				for(var t=0;t<_y[(i-1)*(pre+1)];t++){
					workAF[t]=0;
				}
				temp=0;
				while(temp==0){
					for(var p=_y[(i-1)*(pre+1)],lenp=workCF.length;p<lenp;p++){						
						workAF[p]=Math.floor(Math.random() *2);
					}
					for(var q=0,lenq=workCF.length;q<lenq;q++){
						if(workAF[q]<workCF[q]){
							temp=1;
							break;
						}
						if(workAF[q]>workCF[q]){
							break;
						}
					}
					
				}
				for(var t0=workBF.length-1;t0>=0;t0--){
					workDF[t0+1]=workDF[t0+1]+workAF[t0]+workBF[t0];
					if(workDF[t0+1]>1){
						workDF[t0+1]-=2;
						workDF[t0]++;
					}
				}
				if(workDF[0]==0){
					for(var t1=0,lent1=workAF.length;t1<lent1;t1++){
						workCF[t1]=workDF[t1+1];
					}
				}
				else{
					for(var t2=0,lent2=workAF.length;t2<lent2;t2++){
						workCF[t2]=workDF[t2];
					}
				}
				for(j=0;j<pre;j++){
					workBF[j]=rho[(x-1)*pre+j];
				}
				for(var t3=0,lent3=workCF.length;t3<lent3;t3++){
					if(workCF[t3]>workBF[t3]){
						judge=1;
						break;
					}
					if(workCF[t]<workBF[t]){
						break;
					}
				}
				if(judge==0){
		        return s*x;
				}
				else continue;
			}
		}
		}
		
	};
	
